import React from "react"
import TeamChars from "./TeamChars";

function Team( { teamChars } ) {

    const teamArray = teamChars.map((char) => {
        return <TeamChars key={char.name} char={char}/>
    })

    return (
        <div>
            <div>Anchor
                {teamArray[2]}
            </div>
            <div>Mid
                {teamArray[1]}
            </div>
            <div>Point
                {teamArray[0]}
            </div>
            {teamArray}
        </div>
    )
}

export default Team;
